import React, { useState, useEffect } from "react";
import "./IngredientsPage.css";

const IngredientsPage = () => {
    const [ingredients, setIngredients] = useState([]);
    const [newIngredient, setNewIngredient] = useState({ id: "", name: "", caloriesPerGram: "" });
    const [deleteId, setDeleteId] = useState("");

    useEffect(() => {
        fetch("/ingredients")
            .then((response) => response.json())
            .then((data) => setIngredients(data));
    }, []);

    const handleAddIngredient = (e) => {
        e.preventDefault();
        fetch("/ingredients", {
            method: "POST",
            headers: { "Content-Type": "application/json" },
            body: JSON.stringify({ ...newIngredient, caloriesPerGram: parseFloat(newIngredient.caloriesPerGram) }),
        })
            .then((response) => response.json())
            .then((data) => {
                setIngredients((prev) => [...prev, data]);
                setNewIngredient({ id: "", name: "", caloriesPerGram: "" });
            });
    };

    const handleDeleteIngredient = (e) => {
        e.preventDefault();
        fetch(`/ingredients/${deleteId}`, { method: "DELETE" }).then(() => {
            setIngredients((prev) => prev.filter((ingredient) => ingredient.id !== parseInt(deleteId, 10)));
            setDeleteId("");
        });
    };

    return (
        <div className="container">
            <h2>Інгредієнти</h2>
            <table>
                <thead>
                <tr>
                    <th>ID інгредієнта</th>
                    <th>Назва інгредієнта</th>
                    <th>Калорійність (ккал/г)</th>
                </tr>
                </thead>
                <tbody>
                {ingredients.map((ingredient) => (
                    <tr key={ingredient.id}>
                        <td>{ingredient.id}</td>
                        <td>{ingredient.name}</td>
                        <td>{ingredient.caloriesPerGram}</td>
                    </tr>
                ))}
                </tbody>
            </table>
            <div>
                <h3>Додати інгредієнт</h3>
                <form onSubmit={handleAddIngredient}>
                    <input type="number" name="id" placeholder="ID Інгредієнта" value={newIngredient.id} onChange={(e) => setNewIngredient({ ...newIngredient, id: e.target.value })} required />
                    <input type="text" name="name" placeholder="Назва Інгредієнта" value={newIngredient.name} onChange={(e) => setNewIngredient({ ...newIngredient, name: e.target.value })} required />
                    <input type="number" name="caloriesPerGram" placeholder="Калорійність (ккал/г)" value={newIngredient.caloriesPerGram} onChange={(e) => setNewIngredient({ ...newIngredient, caloriesPerGram: e.target.value })} required />
                    <button type="submit">Додати інгредієнт</button>
                </form>
            </div>
            <div>
                <h3>Видалити інгредієнт</h3>
                <form onSubmit={handleDeleteIngredient}>
                    <input type="number" value={deleteId} onChange={(e) => setDeleteId(e.target.value)} placeholder="ID Інгредієнта" required />
                    <button type="submit">Видалити</button>
                </form>
            </div>
        </div>
    );
};

export default IngredientsPage;
